import React from 'react';
import { Route, Navigate } from 'react-router-dom';

const PrivateRoute = ({ element, ...rest }) => {
  // Sprawdź, czy użytkownik jest zalogowany (np. poprzez sprawdzenie, czy jest zapisana sesja użytkownika)
  const isLoggedIn = localStorage.getItem('loggedIn'); // Przykładowa logika sprawdzająca zalogowanie

  return isLoggedIn ? <Route {...rest} element={element} /> : <Navigate to="/login" />;
};

export default PrivateRoute;
